import { VirtualDOM } from '@youwol/flux-view'
import { ParagraphView, AppIcon } from './views'
import { PlatformState } from '@youwol/os-core'

/**
 * @category View
 */
export class ShowRoomView implements VirtualDOM {
    /**
     * @group Immutable DOM Constants
     */
    public readonly class = 'd-flex justify-content-center'

    /**
     * @group Immutable DOM Constants
     */
    public readonly children: VirtualDOM[]

    /**
     * @group Immutable DOM Constants
     */
    public readonly style = {
        fontSize: 'large',
    }

    constructor({ platformState }: { platformState: PlatformState }) {
        this.children = [
            {
                class: 'w-50 rounded p-5',
                style: {
                    backgroundColor: 'rgba(0,0,0,0.3)',
                },
                children: [
                    new TitleView({
                        title: 'An example of 3D re-meshing using Flux',
                    }),
                    new MeshFluxView({ platformState }),
                    { class: 'mt-3' },
                    new TitleView({
                        title: 'Scikit Learn & Gaussian Processes',
                    }),
                    new GaussianProcessesView({ platformState }),
                    { class: 'mt-3' },
                    new TitleView({
                        title: 'Large Scale 3D Visualization',
                    }),
                    new LargeScale3DView({ platformState }),
                ],
            },
        ]
    }
}

/**
 * @category View
 */
export class TitleView implements VirtualDOM {
    /**
     * @group Immutable DOM Constants
     */
    public readonly tag = 'h2'

    /**
     * @group Immutable DOM Constants
     */
    public readonly innerText: string

    constructor({ title }) {
        this.innerText = title
    }
}

/**
 * @category View
 */
export class ShowRoomElementView implements VirtualDOM {
    /**
     * @group Immutable DOM Constants
     */
    public readonly class = 'd-flex align-items-center'

    /**
     * @group Immutable DOM Constants
     */
    public readonly children: VirtualDOM[]

    constructor({
        paragraphs,
        platformState,
        cdnPackage,
        parameters,
        srcImg,
        title,
    }) {
        this.children = [
            new AppIcon({
                srcImg,
                title,
                platformState,
                cdnPackage,
                parameters,
                size: 100,
            }),
            { class: 'mx-2' },
            {
                class: 'flex-grow-1',
                style: {
                    maxWidth: '750px',
                },
                children: paragraphs.map((paragraph: string | VirtualDOM) => {
                    return typeof paragraph == 'string'
                        ? new ParagraphView(paragraph.replace(/\n/g, ' '))
                        : paragraph
                }),
            },
        ]
    }
}

const paragraphsMeshFlux = [
    `This application hase been built using the low code solution 'Flux' (proof of concept, not yet readily available).
    It uses the C++ <a href='https://www.pmp-library.org/'>PMP library</a> to demonstrates 3 kinds
    of re-meshing solutions. Computations are run in parallel using dedicated threads.`,
    `It also illustrates a preview of the low code application <i>Flux</i> in builder mode. It is remarkable that
    its modules can be written in C, C++, Rust, Go, etc.`,
]
/**
 * @category View
 */
export class MeshFluxView extends ShowRoomElementView {
    constructor({ platformState }) {
        super({
            paragraphs: paragraphsMeshFlux,
            platformState,
            srcImg: 'data:image/jpeg;base64,',
            title: '3D Mesh',
            cdnPackage: '@youwol/flux-builder',
            parameters: {
                id: 'e4a7e20f-70d3-4d89-baf2-ef3d5e04dc07',
            },
        })
    }
}

